script: |
  super -f tsv -I q6994.sql | sort > q6994.out

vector: true

inputs:
  - name: q6994.sql
    data: |
      pragma pg
      SELECT DISTINCT + 40 / + + col0 AS col2 FROM tab0 GROUP BY col0, col0, col2 HAVING NOT ( NOT + - 80 BETWEEN NULL AND + - 73 ) OR NOT ( + col0 >= - COUNT ( * ) + - COUNT ( DISTINCT - col0 ) );
  - name: tab0

outputs:
  - name: q6994.out
    data: |
